const myImage = new Image();
myImage.src = "data:image/png;base64,";


// IMAGEM 1

// para a imagem nÃ£o quebrar, dependendo do provedor ou davelocidade da interne passa a imagem, como string, atravÃ©s da base64, e dentro da funÃ§Ã£o load(), para carregar a imagem

myImage.addEventListener("load", function () {
  // a const canvas Ã© para pegar o elemento canvas
  const canvas = document.getElementById("canvas1");
  // a const ctx Ã© para ter os mÃ©todos de desenho do canvas disponÃ­veis
  const ctx = canvas.getContext("2d");
  canvas.width = 300;
  canvas.height = 500;

  // Para desenhar no canvas, passa se o draw
  // HÃ¡ 3 formas formas,
  //   // serÃ¡ usado aqui a  que espera 5 argumentos
  //   // o primeiro:
  //   //                1. A imagem que quero
  //   //                2. e 3. O nÃºmenro 0 (zero) Ã© passado duas vezes, Ã© para aparecer no canto superior esquerdo e cobrir toda a area do canvas
  //   //                4. e 5.  canvas.width, canvas.height
  // const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);


  let particlesArray = [];
  // essa const numberOfParticles, Ã© usada para definir a quantidade particulas que caem em cima da imagem
  const numberOfParticles = 5000;

  // Ã© criado uma classe particulas,
  // ela serÃ¡ usada para criar as 5000 particulas iguais
  // essas 5000 mil particulas serÃ£o adicionadas ao Arraty vazio, criado anteriormente:
  //                            let particlesArray = [];
  // o constructor() da classe Particulas receberÃ¡ cada aprticula individualmente
  // O x receberÃ¡ um nÃºmero aletÃ³rio entre 0 e a LARGURA da tela
  // para as particulas se espalharem, Ã© definido o inicio da coordenada horizontal em 0.
  //para a velocidade, Ã© definido inicialmente em 0
  // a velocidade de queda erÃ¡ um nÃºmento aleatÃ³rio entre 0  e 3.5
  // a velocidade de queda tambÃ©m depende do brilho da imagem
  // quanto MENOS brilho, mais rapido a queda
  // quanto MAIS brilho, mais rapido a queda
  // this.velocity, o random() Ã© multiplicado por 0.5, isso Ã© apenas para dar mais aleatoriedade
  // o tamanho tambÃ©m terÃ¡ uma aleatoriedade entre 1 e 2.5
  class Particles {
    constructor() {
      this.x = Math.random() * canvas.width;
      this.y = 0;
      this.speed = 0;
      this.velocity = Math.random() * 3.5;
      this.size = Math.random() * 1.5 + 1;
    }

    // aqui serÃ¡ criado um mÃ©todo para atuzalizaÃ§Ã£o das particulas, quadro a quadro, o: this.y += this.velocity.
    // esse this.y+= velocity farÃ¡ com que apÃ³s as particulas chegarem no final retornam para o inicio da imagem e caem novamente, ams agora o this.y, rceve a velocity e caem de forma diferente da anterior

    // quando as particulas chegarem no final do canvas, elas receberÃ£o um if(), redefinindo elas para o inÃ­cio da tela em 0,
    // e cairÃ£o novamente de forma aleatÃ³ria

    //
    update() {
      this.y += this.velocity;
      if (this.y >= canvas.height) {
        this.y = 0;
        this.x = Math.random() * canvas.width;
      }
    }

    // o metodo draw faz um circulo, e desenha cada particula,    



    // o mÃ©todo draw de desnho, desenharÃ¡  de desenho especÃ­fico, ou seja, AQUI ELE FARÃ um circulo representando APENAS UMA PARTICULA.
    // comeÃ§ara com um estilo em branco
    // o ctx arc() para desenhar um arco de particulas sobre  imagem, ddando o aspecto de terra caindo sobre a imagem em auto relevo, passa os parÃ¢metros tamanho de x Ã  y, angulo inicil e angulo final da imagem
    // o fill() Ã© chamado aqui para preenchera o circulo da partucla 
    draw() {
      ctx.beginPath();
      ctx.fillStyle = "white";
      ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
      ctx.fill();
      // //
    }
  }
  // a function init() Ã© reponsavel para iniciar um loop qua ficarÃ¡ acontecendo e passando o total de particulas passadas anterioremnte ou seja, 5000.
  // cada vez que o loop aconetce o Array vazio Ã© chamado:
  //                                                        let particlesArray = [];
  // CADA VEZ QUE O FOR ACONTECE ELE PEGA AS UMA DAS 5000 PARTICULAS E COLOCA NO ARRAY FAZIO,
  // E CHAMA A CLASS PARTICULA() (NEW PARTICULAS()), E ESSA CLASSE TEM TODO O MAQUINÃRIO:
  //                  - O TAMNAHO
  //                  - VELOCIDADE
  //                  - AS FUNÃ‡Ã•ES RANDOMS()
  //                  - O METODO UPDATE()
  //                  - O MÃ‰TODO DRAW()
  // QUE CONTRUIRÃ UMA NOVA PARTICULA
  // NO PRIMENRO LOOP TEREMOS APENAS UMA PARTICULA, ISSO ACONTECERÃ AS 5000 VEZES ATÃ‰ PREENCHE TODO O ARRAY COM AS 5000 PARTICULAS PASSADAS, CRIANDO OBEJETOS (PARTICULAS EM BRANCO), DENTRO DESSE ARRAY.
  // esse for apenas cricou e colocou as particulas dentro desse array   
  function init() {
    for (let i = 0; i < numberOfParticles; i += 1) {
      particlesArray.push(new Particles());
    }
  }
  init();


  // para animar as particulas, 
  // Ã© criado um loop de animaÃ§Ã£o 
  // cria-se um retangulo preto semi transparente, o ctx.globalAlpha = 0.05;
  // isso farÃ¡ um aspecto de desaparecimento da imagem gradul,
  // que acontecerÃ¡ de forma gradual de acordo com o valor passado dentro do valore recebido pelo Alpha
  // quanto MAIOR o nÃºmeros de zeros antes do ponto, mais CLARO E LENTO vai ficando a imagem
  // quanto MENOR o nÃºmeros de zeros antes do ponto, OU SEJA, NÃšMENROS INTEIROS, mais ESCURO E mais RÃPIDO vai ficando a imagem
  // apÃ³s a imagem esvaecer, Ã© criado um quadro preto pelo ctx.fillStyle(), esse fillstyle() passa apenas a cor
  // o fillRect() desenha o quadro com as dimensÃµes necessÃ¡rias, ou seja, em cima do canvas criado no comeÃ§o do trabalho
  // Esse for percorre todo  arrray criado com as particulas, no for anterior que apenas criava as particulas.
  // depois de percorrer todo o for ele recalcula cada posiÃ§Ã£o desse objeto particulas, e anima essas particulas dentro do canvas, dando o aspecto de queda. 

  // mas sÃ³ isso nÃ£o fasz animaÃ§Ã£o, tem que chamar o  
  // requestAnimationFrame(animate) e passar a funÃ§Ã£o dentro dela
  function animate() {
    // o ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    // foi tirado de onde estava e colocado aqui temporariamete para podermos ver a imagem original, onde ela estava, em cima do :  let particlesArray = []; a imagem desaparecia apÃ³s algus segundos
    ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    ctx.globalAlpha = 0.05;
    // // 
    ctx.fillStyle = "rgb(0, 0, 0)";
    ctx.fillRect(0, 0, canvas.width, canvas.height);
    for (let i = 0; i < particlesArray.length; i += 1) {
      particlesArray[i].update();
      particlesArray[i].draw();
    }
    //  o mÃ©tod requestAnimationFrame(animate) Ã© mais sutil na transiÃ§Ã£o dos frames da animaÃ§Ã£o, que o for, ou randon()
    // o metodo requestAnimationFrame(), cria uma recursÃ£o repetidamente, e repetidamente
    requestAnimationFrame(animate);
  }
  animate();
});




